import userEvent from '@testing-library/user-event';
import {useState} from 'react';

class Box {
  constructor(i, j) {
    this.left = true;
    this.right = true;
    this.top = true;
    this.bottom = true;
    this.i = i;
    this.j = j;
  }
}


const [grid, setGrid] = useState([]);

for (let i = 0; i < 8; i++) {
  grid[i] = [];
  for (let j = 0; j < 8; j++) {
    grid[i][j] = new Box(i, j);
  }
}

export const makeMaze = (grid) => {
   for (let i = 0; i < grid.length; i++) {
      for (let j = 0; j < grid[i].length; j++) {
         grid[i][j].i++;
         console.log("ss");
      }      
   }
}


export const myGrid = grid.map((x) => x);
